import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';
import { FaCar, FaSprayCan, FaBroom, FaShieldAlt, FaBars } from 'react-icons/fa';

const AboutPage = () => {
  const [activeFeature, setActiveFeature] = useState(0);
  const navigate = useNavigate();

  const features = [
    { title: "Full Detailing", icon: <FaCar />, description: "Comprehensive interior and exterior detailing for a showroom-fresh look." },
    { title: "Exterior Washing", icon: <FaSprayCan />, description: "Gentle yet thorough exterior cleaning to protect your vehicle's paint." },
    { title: "Interior Cleaning", icon: <FaBroom />, description: "Deep cleaning of all interior surfaces, leaving your car fresh and pristine." },
    { title: "Paint Protection", icon: <FaShieldAlt />, description: "Advanced ceramic coating to shield your car's paint from environmental damage." },
  ];

  return (
    <div className="bg-gray-100 text-gray-900 min-h-screen">
      <nav className="bg-white p-4 flex justify-between items-center fixed w-full z-10">
        <Link to="/" className="text-2xl font-light">JR Auto Detailing</Link>
        <div className="flex items-center space-x-6">
          <NavLink to="/models">Models</NavLink>
          <NavLink to="/customize">Customize</NavLink>
          <NavLink to="/services">Services</NavLink>
          <button className="text-sm uppercase tracking-wide"><FaBars /></button>
        </div>
      </nav>

      <main className="pt-16 flex flex-col md:flex-row">
        <div className="w-full md:w-1/2 p-8 flex flex-col justify-between">
          <div>
            <motion.h2 
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5 }}
              className="text-5xl font-light mb-2"
            >
              A Car of Concepts
            </motion.h2>
            <motion.p 
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.2 }}
              className="text-xl mb-4"
            >
              Elevate your driving experience
            </motion.p>
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="bg-gray-900 text-white px-8 py-3 rounded-full text-sm font-semibold uppercase tracking-wide"
              onClick={() => navigate('/services')}
            >
              View Services
            </motion.button>
          </div>

          <div className="mt-8">
            <div className="flex justify-between mb-4">
              {features.map((feature, index) => (
                <motion.div
                  key={index}
                  className={`text-center cursor-pointer ${index === activeFeature ? 'text-gray-900' : 'text-gray-500'}`}
                  whileHover={{ scale: 1.1 }}
                  onClick={() => setActiveFeature(index)}
                >
                  <div className="text-3xl mb-2">{feature.icon}</div>
                  <p className="text-xs uppercase">{feature.title}</p>
                </motion.div>
              ))}
            </div>
            <motion.p
              key={activeFeature}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.3 }}
              className="text-sm"
            >
              {features[activeFeature].description}
            </motion.p>
          </div>
        </div>

        <div className="w-full md:w-1/2 relative">
          <img
            src="/path-to-your-car-image.jpg"
            alt="Luxury concept car"
            className="w-full h-full object-cover"
          />
          <div className="absolute bottom-8 left-8 right-8">
            <div className="grid grid-cols-3 gap-4">
              <img src="/path-to-detail-1.jpg" alt="Detail 1" className="w-full h-24 object-cover" />
              <img src="/path-to-detail-2.jpg" alt="Detail 2" className="w-full h-24 object-cover" />
              <img src="/path-to-detail-3.jpg" alt="Detail 3" className="w-full h-24 object-cover" />
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

const NavLink = ({ to, children }) => (
  <Link 
    to={to} 
    className="text-sm uppercase tracking-wide hover:text-gray-600 transition-colors duration-300"
  >
    {children}
  </Link>
);

export default AboutPage;
